def compare(model1, model2):
    size = len(model1)
    count_mod1 = 0
    count_mod2 = 0

    for index in range(size):
        cur_mod1 = model1[index]
        if (index > len(model2) - 2) :
            cur_mod2 = cur_mod1
        else:
            cur_mod2 = model2[index]
        if cur_mod1 > cur_mod2:
            count_mod1 += 1
        elif cur_mod1 < cur_mod2:
            count_mod2 += 1
        else:
            count_mod1 += 0.5
            count_mod2 += 0.5
    return count_mod1/size, count_mod2/size

def compareAll(model1, model2, model3, model4):
    size = len(model1)
    count_mod = [0, 0, 0, 0]

    for index in range(size):
        cur_mod1 = model1[index]
        cur_mod2 = model2[index]
        cur_mod3 = model3[index]
        if (index > len(model2) - 2) :
            cur_mod4 = cur_mod1
        else:
            cur_mod4 = model4[index]

        maxVal = max(cur_mod1, cur_mod2, cur_mod3, cur_mod4)
        if maxVal == cur_mod1 :
            count = 0
        elif maxVal == cur_mod2 :
            count = 1
        elif maxVal == cur_mod3 :
            count = 2
        elif maxVal == cur_mod4 :
            count = 3
        else:
            print('Huston we have a problem here')
            return
        count_mod[count] += 1
    for cur_count in range (4):
        count_mod[cur_count] /= size
    return count_mod

def compareSub(model1, model2):
    size = len(model1)
    sum = 0

    for index in range(size):
        cur_mod1 = max(model1[index], -1)

        if (index > len(model2) - 2) :
            cur_mod2 = cur_mod1
        else:
            cur_mod2 = max(model2[index], -1)

        diff = cur_mod1 - cur_mod2
        sum += diff
    return sum



